import React from 'react';
import logo from './log2.png';
import './index.css';
import profile from './patient.png'
import appointment from './doctor-consultation.png'
import history from './examination(1).png'
import help from './patient.png'
function main(){
  return(  
    <div>
       <header>
        <img src={logo} alt="l"  />
        <h1>MEDIsync</h1>
        <p>logout</p></header>
    
   <div className='navbar'>
  
    <div className='navs' id='profile'><p>Profile</p> <img src={profile} alt="" /></div>
    <div className='navs' id='appointment'><p>Appointment Allocation</p> <img src={appointment} alt="" /></div>
    <div className='navs' id='history'><p>Medical History <img src={history} alt="" /></p></div>
    <div className='navs' id='help'><p>Help</p><img src="" alt="" /></div>
  
  </div>

    </div>
  
   
  )
}
export default main;
